            'public class ReduceFractionTest{\n \npublic static void main(String[] args)\n{\n    int x1 = 12;\n    int y1 = 30;\n    int x2 = 212;\n    int y2 = 10;\n    int x3 = 10;\n    int y3 = 10;\n \n    reduceFraction(x1, y1);\n    reduceFraction(x2, y2);\n    reduceFraction(x3, y3);\n}\n \n   static void reduceFraction(int x, int y)\n   {\n    int d;\n    d = __gcd(x, y);\n \n    x = x / d;\n    y = y / d;\n    \n    if(y%x==0) {\n        System.out.println(y);\n    }\n    else {\n    System.out.println(y+"/"+ x);\n   }\n  }\n   static int __gcd(int a, int b)\n    {\n    if (b == 0)\n        return a;\n    return __gcd(b, a % b);\n     \n   }\n}',
