            "using System;\nClass ClockAngleTest{\n   \n   public static void Main ()  \n    { \n        Console.WriteLine(test_hour_hand_is_at_10_and_angle_degree_should_be_300()); \n        Console.Write(test_hour_hand_is_at_1_and_angle_degree_should_be_30()); \n        Console.Write(test_hour_hand_is_at_5_and_angle_degree_should_be_150()); \n        Console.Write(test_minute_hand_is_at_40_and_angle_degree_should_be_240()); \n   Console.Write(test_calculate_angle_degree_between_hour_hand_is_at_1_and_minute_hand_is_at_12_in_half_rotation());   \n        ​Console.Write(test_calculate_angle_degree_between_hour_hand_is_at_1_and_minute_hand_is_at_45_in_full_rotation()); \n}  \n \n  ​static bool test_hour_hand_is_at_10_and_angle_degree_should_be_300(){\n   ​int expectedDegree = 300;\n   ​int hour = 10;\n   ​int minute = 0;\n    ​\n   ​if (GetAngle(hour,minute)==expectedDegree) {\n     ​return true;\n    }\n      ​else{\n     ​return false;\n      }\n  ​}\n \n  ​static bool test_hour_hand_is_at_1_and_angle_degree_should_be_30(){\n   ​int expectedDegree = 30;\n   ​int hour = 1;\n   ​int minute = 0;\n    ​\n    ​if (GetAngle(hour,minute)==expectedDegree) {\n        ​return true;\n       }\n         ​else{\n        ​return false;\n         }\n    }\n \n \n  ​static bool test_hour_hand_is_at_5_and_angle_degree_should_be_150(){\n   ​int expectedDegree = 150;\n   ​int hour = 5;\n   ​int minute = 0;\n    ​\n    ​if (GetAngle(hour,minute)==expectedDegree) {\n        ​return true;\n       }\n         ​else{\n        ​return false;\n         }\n  ​}\n \n  ​static bool test_minute_hand_is_at_40_and_angle_degree_should_be_240() {\n   ​int expectedDegree = 240;\n   ​int hour = 0;\n   ​int minute = 40;\n    ​\n    ​if (GetAngle(hour,minute)==expectedDegree) {\n        ​return true;\n       }\n         ​else{\n        ​return false;\n         }\n  ​}\n \n  ​static bool test_calculate_angle_degree_between_hour_hand_is_at_1_and_minute_hand_is_at_12_in_half_rotation() {\n   ​int expectedDegree = 36;\n   ​int hour = 1;\n   ​int minute = 12;\n    ​\n    ​if (GetAngle(hour,minute)==expectedDegree) {\n        ​return true;\n       }\n         ​else{\n        ​return false;\n         }\n  ​}\n \n​static bool test_calculate_angle_degree_between_hour_hand_is_at_1_and_minute_hand_is_at_45_in_full_rotation() {\n   ​float expectedDegree = 142.5;\n   ​int hour = 1;\n   ​int minute = 45;\n    ​\n    ​if (GetAngle(hour,minute)==expectedDegree) {\n        ​return true;\n       }\n         ​else{\n        ​return false;\n         }\n  ​}\n}",
