            '/* So I soldered big photoresistors (small ones need more light) onto the small board\nthat hides in a keyboard. Found some combinations to make for two symbols typed on the\nsecure offline machine. Connect the dark grey leads with any wire to first find the\ncharacters you want typed then scratch off the dark grey stuff and solder onto those\nleads--on the keyboard PCB. Then orient them to the terminal blinkers as shown here.\nNot easily reproducible as your room needs a certain amount of light already as a\nsort of pre-charge to the photoresistors. Good stuff though, can pass any data\nwith 100% precision when in the right room. Slow... Might let this one go.\nUNLESS someone brings me eight keyboards and many more photoresistors.\nAnd a USB splitter. Then each keyboard gives two char indicating if\na 1 or 0 is present for their assigned place value of 256 and halved down.\nStill playing with the RAM corruption and serial ATA SCPA in the bachground... */\n \n \n \n \n \n \n \n \n \n \n \n#include <iostream>\nusing namespace std;\n \nint main()\n{       cout << "Center photoresistors against the two spots THEN press enter and connect this\\n"\n             << "apparatus on the receiving machine. (Set terminal colors to white on black.)";\n        for(int a = 0; a < 14; a++) {cout << "\\n";}\n        cout << "           ###        ###\\n\\n\\n\\n\\n\\n\\n";\n        char wait[1]; cin.getline(wait, 1);\n        \n        for(int a = 0; a < 50; a++) {cout << "\\n";}\n        cout << "                                               Press enter to generate 10 bytes.";\n        cin.getline(wait, 1);\n        \n        long long timing = 30000000; //30,000,000 ok for 2.26Ghz, increase it if your spy-box is fancy.\n        for(;;)\n        {       //Scrolls down through emptyness.\n                for(int a = 0; a < 80; a++)\n                {       cout << "\\n";\n                        \n                        //Wastefully consumes time. This too occupies RAM but quietly.\n                        for(int waste = 0; waste <= 10000000; waste++) {}\n                }\n                \n                //n = bytes to generate (currently 10 bytes)\n                for(int n = 0; n < 10; n++)\n                {       cout << "                      ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 0\n                        \n                        cout << "                      ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 0\n                        \n                        cout << "           ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 1\n                        \n                        cout << "                      ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 0\n                        \n                        cout << "           ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 1\n                        \n                        cout << "                      ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 0\n                        \n                        cout << "           ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 1\n                        \n                        cout << "           ###";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                        for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 1\n                }\n                \n                //Writing 2 bits to end the stream.\n                cout << "           ###";\n                for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 1\n                \n                cout << "           ###";\n                for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n";\n                for(int waste = 0; waste <= timing; waste++) {} cout << "\\n\\n"; // 1\n                \n                cout << "\\n\\n\\n\\n\\n\\n\\n";\n                cout << "                                         Press enter to generate 10 bytes again.";\n                char wait[1]; cin.getline(wait, 1);\n        }\n}',
