          title: "RICIN but for uploading: 1-bit interjecting disk",
          content:
            "So far with RICIN, I have provided the general public with unrestricted software\nand design for securely downloading off the internet via restricted one-way\ninterface from a compromised online machine to a secure offline machine.\nI'm sure there are those using these tools for uploading as well, but that's\nstrongly discouraged due to the fact that signal analysis has been perfected\nlong ago, and that you should always assume your proprietary things are constantly\nbroadcasting your computer details.\n \nHad your secure offline machine been trusted and design--verified, you wouldn't\nworry about it encoding keys on top of what's already being sent through the mp3\nfiles as produced by the four RICIN systems:\n \nRICIN       via sound.\nRICINgauss  via transformer.\nRICINgauss  via standard aux cord (must set boolean standard_aux_cord to true.)\nRICINoptic  via LED blinking and photoresistor.\n \nRICINram is yet another method (concept proven) but not yet built or may be a pivot to RICINout:\nGiven that security is impossible through any attempt to assemble your proprietary things in some\nclever way, you are forced to download only, so far. But now the general public needs the same\nsecurity-over-convenience for uploading things like 613kB Authorship.public files.\n \nWith signal analysis in mind, it was only satisfactory to simply discourage uploading to a\ncompromised online machine with the existing 4 RICIN methods... Because I am not aware of\nany laptops with the freedom to look around and perhaps barge into their manufacturing plants\nat any time I please. For this reason, the burden is on me (and you) to build an interjecting\nstorage device capable of holding one bit and letting it go quickly if parity check with sender ok.\n \nThe problem is that current RICIN systems are technically (live to the receiver) meaning signal\nstrength and characteristics are present at any time the sender blindly broadcasts or receives\nproprietary instructions from nearby machines and devices (spend the time to think about this\nas long as I have and you'd be concerned.)\n \nTherefore a trusted device is necessary which interjects the signal from offline to online,\nmakes its own determination about its correctness, then sends it to the compromised online\nmachine USING ITS OWN MONOTONE SIGNAL CHARACTERISTICS which can never be bumped or timed differently\nby the sender. I think you know what I mean.\n \nAnd given the difficulty of building an array of flipping dots or something to hold information with\nthe ability to hash what it's holding and display it for your eyes to compare with sender, we will\nbuild only one \"flipping dot\" and a fast one which matches and fits with current RICIN systems(< 1,100B/s.)\n \n \n \nBut let's not stop there. Proprietary software and design means there is still no security,\neven with this in mind and especially if automating this system and letting it sit there\nconnected for years without you seeing spikes and blinks that should't be there for quiet times.\nThe \"secure offline machine\" in this case will be downloading every once in a while (that is the\nsecurity I wish to provide here--download and upload securely.)\n \nClearly, the offline machine could have caught some instructions while downloading and\neventually fulfill them years later when you're not looking. Maybe \"they\" had tome to play\nwith RICIN systems which inspired a global secret update to BIOS or whatever--which then\nmight successfully screw with the PROBLEM of uploading after having downloaded!\n \nClearly this is a conundrum, and until you have unrestricted software and hardware combined,\nit is never safe to upload anything ever. But how will you upload your Authorship.public files\nwithin your lifetime?\n \nNot sure. Download only! Meanwhile I'm destroying RAM for RICINram, as well as thinking about all this further.",
