            'class Solution(object):\n    def lengthOfLongestSubstring(self, s):\n        """\n        :type s: str\n        :rtype: int\n        """\n \n        keypos = {}\n        longest = 0\n        current_start = 0\n        \n        for i, c in enumerate(s):\n            \n            #print(i, c)\n            \n            if c in keypos.keys():\n                \n                length = i - current_start\n                current_start = max(current_start, keypos[c] + 1)\n                keypos[c] = i\n                \n                if length > longest:\n                    longest = length\n                    \n            keypos[c] = i\n \n \n        if longest == 0:\n            \n            return len(s)\n            \n        return max(longest, len(s) - current_start)',
