            "from itertools import zip_longest\n \n# Definition for singly-linked list.\nclass ListNode:\n    def __init__(self, val=0, next=None):\n        self.val = val\n        self.next = next\n \ndef list_wrapper(s):\n    cur = s\n    while cur:\n        yield cur.val\n        cur = cur.next\n \n        \ndef get_tail(val):\n    tail = ListNode()\n    tail.next = None\n    tail.val = val\n    \n    return tail\n    \n        \nclass Solution:\n    \n    def addTwoNumbers(self, l1: ListNode, l2: ListNode) -> ListNode:\n        overflow = 0\n        s = None\n        cur = None\n        \n        for d1, d2 in zip_longest(list_wrapper(l1), list_wrapper(l2), fillvalue=0):\n            d_sum = d1 + d2 + overflow\n            \n            if not s is None:\n                cur.next = get_tail(d_sum % 10)\n                cur = cur.next\n            else:\n                s = get_tail(d_sum % 10)\n                cur = s\n                \n            overflow = d_sum // 10\n            \n        if overflow:\n            cur.next = get_tail(1)\n            \n        return s",
