          title: "Update on RICINram: quiet OS is better, CPU noise.",
          content:
            "/* Booting into TinyCore (the new 21MB image) gives clean silence and a steady glow\nof the LED otherwise bigger OSes keep utilizing RAM and power and it's visible (things\nlike blinking cursor, desktop updates for visual power usage and time & date, and even\nthe filling of the Ctrl+z clipboard--LED blinks if you hold down a keyboard key.)\n \nThis is like SCPA but mostly for RAM. Anyways, unless I deal with that annoying\nnoise again like I did with RICINoptic, and unless I de-solder some kind of faster\nitems for signal processing, the RICINram will become a very useful and live system\nwhere you need not convert & play with audio files and editors all all--live codec. !?*/\n \nThis here is a proof of concept. Use this to visualize the blinking and adjust.\nIf you don't have the receiving equipment set up but only the sending as in the\ngithub images, then at least use slo-mo on your compromised slave botnet snitching\ncellphone. (I don't have one and never will again, and look--I'm still alive and well.)\nPurpose being: so you can interrogate for faster blinking before you solder all the\nitems you assume will work together nicely. Do enjoy.\n \n \n \n \n \n \n \n/* Occupies RAM and prints the state of such activity. Meanwhile, your physical\nindicator should already by soldered:  github.com/compromise-evident/RICINram */\n \n#include <iostream>\nusing namespace std;\n \nint main()\n{       bool table[1000000] = {0};\n        \n        for(int n = 0; n < 50000; n++)\n        {       //Occupies 100kB of RAM.\n                if(table[0] == 0)\n                {       for(int a = 0; a < 1000000; a++) {table[a] = 1;}\n                }\n                else\n                {       for(int a = 0; a < 1000000; a++) {table[a] = 0;}\n                }\n                \n                cout << (n + 1) << \"\\n\";\n                \n                //Wastefully consumes time. This too occupies RAM but quietly.\n                for(int waste = 0; waste <= 8000000; waste++) {} //8000000 visible fast blink, lower is faster.\n        }\n}",
