            'class JA\n{\n \n \nstatic void reduceFraction(String input)\n{\n        string[] inputList = input.Split("/"); \n        int x=Int16.Parse(inputList[0]);\n        int y=Int16.Parse(inputList[1]);\n \n        int d;\n        d = gcd(x, y);\n \n        x = x / d;\n        y = y / d;\n \n        if(x==0){\n          Console.WriteLine(y);\n        }\n        elseif(y==0){\n          Console.WriteLine(x);\n        }\n        else{\n           Console.WriteLine(y+"/"+x);\n        }       \n}\n \nstatic int gcd(int a, int b)\n{\n        if (b == 0)\n                return a;\n        return gcd(b, a % b);\n        \n}\n \n \npublic static void Main(String[] args)\n{\n        String input1= "60/90";\n        \n        reduceFraction(input1);\n}\n}',
